import React, { Component } from 'react'
import './App1.css';






class App1 extends Component {
    render() {
      return (
        <div>
          <section>
            <header>
           
              <div>
                <ul>
                  <li>HOME</li>
                  <li>ABOUT</li>
                  <li>SERVICES</li>
                  <li>BLOG</li>
                </ul>
              </div>
           
            </header>
          </section>
        
         
          <section id="main">
            <div className="main-text">
              <span>Are you Hungry?</span> <br />Don't Wait!!! <br />
             
            </div>
  
            
          </section>


          <img src="/images/food.png"></img>
        </div>
      );
    }
  }




export default App1;
